import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'typeface-roboto';
import {AppBar, Toolbar, Tabs, Typography, Tab} from '@material-ui/core'

function App() {
  return (
    <AppBar position="static">
  <Toolbar>
    <Typography variant="h4" style={{marginRight: '30px'}}>
      Fire Buster
    </Typography>
    <Tabs>
      <Tab label='Alerts'/>
      <Tab label='Report Wildfire'/>
      <Tab label='Statistic'/>
    </Tabs>
  </Toolbar>
</AppBar>
  );
}

export default App;
